import './App.scss'
import FirstPage from "./component/FirstPage";
import SecondPage from "./component/SecondPage";
const App = (props) => {
    return (
        <div className="app-container">
            <div className="header-container">
                <Header/>
            </div>
            <FirstPage />
            <SecondPage/>
        </div>
    )
}

export default App;
